import React, { useContext, useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import {
  Box,
  Typography,
  Card,
  CardContent,
  CardActions,
  Button,
  Grid,
  Avatar,
  Chip
} from "@mui/material";
import AddIcon from "@mui/icons-material/Add";
import axios from "axios";
import DashboardLayout from "../components/DashboardLayout";
import { UserContext } from "../contexts/UserContext";

export default function TrainerDashboard() {
  const { currentUser } = useContext(UserContext);
  const navigate = useNavigate();
  const [workshops, setWorkshops] = useState([]);

  useEffect(() => {
    axios
      .get("http://127.0.0.1:8001/workshops/")
      .then((res) => setWorkshops(res.data))
      .catch((err) => console.error("Error fetching workshops", err));
  }, []);

  const myWorkshops = workshops.filter((w) => w.trainer_id === currentUser?.id);

  const menuItems = [
    { label: "My Workshops", path: "/trainer/dashboard" },
    { label: "Create Workshop", path: "/trainer/workshops/create" },
  ];

  return (
    <DashboardLayout menuItems={menuItems}>
      <Box sx={{ display: "flex", justifyContent: "space-between", alignItems: "center", mb: 4 }}>
        <Typography variant="h4" fontWeight="bold" color="primary">
          My Workshops
        </Typography>
        <Button
          variant="contained"
          startIcon={<AddIcon />}
          onClick={() => navigate("/trainer/workshops/create")}
          sx={{
            borderRadius: "20px",
            paddingX: 3,
            textTransform: "none",
            fontWeight: "bold"
          }}
        >
          Create New Workshop
        </Button>
      </Box>

      {myWorkshops.length === 0 ? (
        <Typography variant="body1" color="text.secondary">
          You have not created any workshops yet.
        </Typography>
      ) : (
        <Grid container spacing={3}>
          {myWorkshops.map((workshop) => (
            <Grid item xs={12} sm={6} md={4} key={workshop.id}>
              <Card
                elevation={4}
                sx={{
                  borderRadius: 3,
                  transition: "0.3s",
                  "&:hover": { transform: "translateY(-5px)", boxShadow: 6 }
                }}
              >
                <CardContent>
                  <Box sx={{ display: "flex", alignItems: "center", mb: 1 }}>
                    <Avatar
                      alt={workshop.title}
                      src="/workshop.png"
                      sx={{ width: 50, height: 50, mr: 2 }}
                    />
                    <Typography variant="h6" fontWeight="bold">
                      {workshop.title}
                    </Typography>
                  </Box>
                  <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
                    {workshop.description.slice(0, 60)}...
                  </Typography>
                  <Chip
                    label={`Sections: ${workshop.sections?.length || 0}`}
                    color="primary"
                    size="small"
                    sx={{ mr: 1 }}
                  />
                  <Chip
                    label={`Students: ${workshop.students?.length || 0}`}
                    color="secondary"
                    size="small"
                  />
                </CardContent>
                <CardActions sx={{ justifyContent: "space-between", px: 2, pb: 2 }}>
                  <Button
                    size="small"
                    variant="outlined"
                    onClick={() => navigate(`/workshops/${workshop.id}`)}
                  >
                    View
                  </Button>
                  <Button
                    size="small"
                    variant="contained"
                    onClick={() => navigate(`/trainer/workshops/edit/${workshop.id}`)}
                  >
                    Edit
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      )}
    </DashboardLayout>
  );
}
